Happy almost midpoint (the official astronomical midpoint is on Friday, February 3rd) between winter and spring in the Northern Hemisphere! For our family, we refer to it as Brigid's (in Celtic Lá Fhéile Bríde) Day. This is an opportunity for us to tune not only to our Celtic roots, but to celebrate in our own way, through our own connection to this much colder winter biome. ⁣
⁣
Traditionally, this day would have marked the first day of spring, but we're far away from acknowledging that here in Michigan. So instead of porting over a culture that doesn't quite align and attune to where we're at, we're making it our own - yes, you can do that! ⁣💚
⁣
Instead of new life bursting through the soil, we celebrate:⁣
⁣
🔥Keeping the fire's burning and our own precious light lit even in the darkest times⁣
🔥With soup and deep nourishment to keep ourselves going until the sap runs!⁣
🔥With a creative project inspired by Brigid ⁣and her connection to the forge, midwifery and poetry! 
⁣🔥With medicine journeys for my husband and I to explore the dark and light within us. 
  Make this day your own. You don't need to do anything fancy (I've collected my cultural items and traditions over the course of years), just help your children orient to their place on the Wild Wheel by having something as simple as a conversation. ⁣
⁣
These seasonal points matter so much as they help us connect to the rhythm & growth cycles - the wheel within our own selves. ⁣
⁣
Have a beautiful midpoint, I’d love to hear about your connection and feelings that are arising on this sacred day.  If you are interested, you can follow along here and in my stories for more Midwinter, Imbolc and Candlemas observances
