Our family tunes to a seasonal year, within which we feel most connected to ourselves and nature. ⁣💚
⁣
Today is one of those awareness stops along our journey, it's the Midpoint between summer and fall in the Northern Hemisphere. Traditionally many called this day Lughnasadh, and its meanings were unique unto the cultures that observed it. ⁣🌾
⁣
For us this is First Harvest. ⁣
⁣
The first harvest of cucumbers, tomatoes, our peaches…a time we start to see and taking stock of those seeds we buried bore fruit! ⁣
⁣
It's a celebration of vision, patience, work and belief that the seeds we plant & nourish will grow. We celebrate that by spending time with the plants, picking berries, making raspberry bread. ⁣
⁣
Receiving and thanking the gift that was given. ⁣
⁣
I hope you have a beautiful Midpoint and get a moment to bring your awareness to one aspect of life that is offering beautiful fruit right now.  If you are interested Follow along for more Lammas, Lughnasadh and First Harvest observances
