It’s almost the Autumnal Equinox and it’s time to take stock. ⁣🌾💛
⁣
For me the bounty is a constant reminder of Mother Nature’s values. More often than not - what we nurture and turn our attention to, will grow. ⁣
⁣
This is so comforting in our society where sometimes effort does not equal abundance - those who don’t put in the work, or have the vision may be rewarded simply because of their position. ⁣
⁣
I invite you to enjoy the abundance around you, look at all the seeds you’ve planted - and be reminded that a culture of care is important...that together our baskets overflow. ⁣🧺🍎🍇🍂✨
⁣
Yours,⁣
