This week we will hold our ancestors’ honoring and feast. It isn’t always easy and reminds me that nature-connection isn’t all about rainbows and mud pies (even though you know how much I love those). It’s also about remembering all the life and death that it has taken to grow and nourish the ground beneath our feet. ⁣
⁣
Nature connection is about tradition. It’s about culture. ⁣This experience and the guide I have created draws on my Irish ancestry and their ancient yet still practiced “dumb suppers” and ancestor tables. But it’s important to find your own roots and road back to this practice. Reverence for ancestors is not an uncommon or exotic practice - some version of Dia De Los Muertos, a holy day in which Mexican families welcome back the soils of their relatives who have passed, has been celebrated for thousands of years and had inspired so many to reconnect. 
⁣
And when we reconnect it’s so powerful. The kids often cry, we cry. It can hurt, but it’s beautiful too. This ceremony and time together, as is done in so many cultures, gives children a safe space to express their grief and connect to their ancestral memory. And it helps me prepare for what is to come, for the good ancestor that one day I hope to be. ⁣
⁣
If this resonates with you and you would like a guide to help you rebuild that bridge to those who have passed, those loved ones of heart and land and bone, I have created the Ancestor’s Feast guide (link in bio). ⁣
⁣
May you and your children have the opportunity to nurture your connection to your roots, to that energy and memory that still feeds your lives. ⁣
⁣
Yours, ⁣
⁣
Nicolette⁣

