Slowly but surely Winter Solstice is becoming more of the focal point of our holidays this season. ⁣
⁣
This little salt-dough banner carries representative symbols for this turn of the wheel including a deer (for deer Mother bringing the sun in her horns), a sun (for the return of the light) and a spiral (as we are poised to start another cycle). ⁣
⁣
It might not look like much, but every little move we make bringing Mother Nature back into our celebration makes me feel a little bit more at home and connected to myself. ⁣
⁣
Does anyone else feel that way? What are you shifting to make your family culture and traditions represent your full self? I would love to hear!⁣
⁣
